import React from 'react';

const Reducer = props => {

  const initialState = {
    loginStatus: '',
  }

  const reducer = (action, state = initialState) => {
    switch(action.type) {
      case 'login': return {
        loginStatus: 'LoginSuccess'
      }

      default: return state
    }
  }

}

const store = createStore(reducer)
